import React from "react"
import './style.css';
import Travy from "./travy.mp3" 

function Footer() {
  return (
    <div id="Footer">
      <audio controls autoplay id="audioin">
        <source src={Travy} type="audio/mpeg"/>
      </audio>
    </div>
  );
}

export default Footer;
